wAAkAiCHQAAgEQQ7AAAACSCYAcAACARBDsAAACJ\nINgBAABIBMEOAABAIv4LpObTrjP40+cAAAAASUVORK5CYII="},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"markdown","source":"At first look, the correlation between charges and 3 other numeric data doesn't seem strong! All of them have an R-square of less than 0.5.  \n\nHowever, looking at **bottom row of the panel plots** with charges in the y-axis, you realise that there is some pattern there.\n\n* Age: there seems to be 3 clusters in a general upward trend. More data is needed to understand the separation between the clusters.\n\n* BMI: the majority of high charges belong to obsese group (BMI 30 and above). However, there seems to be a lack of sufficient data for the underweight group (BMI 18.5 and below)\n\n* Children: surprisingly, the more children you have, the lower your medical charges in general!\n\nHow about the quantitative data?\n## Relationships of qualitative data against charges:","metadata":{}},{"cell_type":"code","source":"charges <- df_ins$charges\nsex <- df_ins$sex\nsmoker <- df_ins$smoker\nregion <- df_ins$region\n\nboxplot(charges ~ sex, main = 'Medical Charges VS Sex', col = c(\"pink\", \"light blue\"))\nboxplot(charges ~ smoker, main = 'Medical Charges VS Smoker', col = c(\"steelblue1\", \"salmon1\"))\nboxplot(charges ~ region, main = 'Medical Charges VS Region', col = c(\"thistle2\", \"rosybrown2\", \"bisque\", \"lightgoldenrod\"))","metadata":{"execution":{"iopub.status.busy":"2024-07-05T10:00:43.309221Z","iopub.execute_input":"2024-07-05T10:00:43.310962Z","iopub.status.idle":"2024-07-05T10:00:43.611409Z"},"trusted":true},"execution_count":38,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ1wUV9sG8DNbWXoXsIIFUGwRCxpFbFiwJkI0YonEXmKJNYklsYfksZfYiB2j\nYEMxGmwBFY0tCkYQbDTpAsvWeT8MrgiIS3mZneX6f8hv98xh9naIcnGm3BRN0wQAAAAAuI/H\ndgEAAAAAUD0Q7AAAAAD0BIIdAAAAgJ5AsAMAAADQEwh2AAAAAHoCwQ4AAABATyDYAQ